INSERT INTO `b_thing` VALUES (1,'西瓜呜呜呜哈哈哈','cover/1679058043365.jpeg','打算收拾收拾宿舍','330','0',30,0,'2023-03-11 18:05:25.130644',0,0,1,1,2),(2,'测试商品','cover/1679056479437.jpeg','看看姐姐','9','0',90,0,'2023-03-17 20:34:49.160642',0,0,0,0,3),(3,'古古怪怪哈哈哈哈','cover/1679232756075.jpeg','哈哈哈哈哈哈哈哈哈哈哈刚刚发的第三十四撒身上','9','0',98,0,'2023-03-17 20:35:39.100000',0,0,0,0,2),(4,'哈哈给哥','cover/1679232717023.jpeg','饼干的诞生，背后的故事也同样充满着意外性，在 十九世纪五十年代的某一天，天空乌云密布，忽起狂风，使一艘出海勘察英国帆船触礁，被迫在法国比斯湾附近的一个荒岛上停泊，船员们虽死里逃生，但岛上没有任何食物亦是船员们重生后的又一个难题。百般无奈的他们只好等风停后再次登上那艘已经破烂不堪的船上搜刮粮食，但遗憾的是，船上储备的面粉、奶油、砂糖等等都已经泡在水里了，船员们毫无办法，只好将这一切几乎已经泡烂的东西带到岛上，待面团稍微烘干一点后，将它一点一点地撕下，捏成一个个小团，然后烤熟后分给大家吃。但让人感到意外的是，用此方法烤出来的东西竟是如此美味，酥松香脆，且饱腹感强，船员们因此也有了生存下去的希望。一段时间过后，船员们回到了英国，为了纪念此次脱险，他们再一次用这个方法做出来了同样的美味，并以海湾的名字命名这一份美味为 “比斯湾”，这就是饼干的英文名“ biscuit”的由来。\r\n\r\n然而在世界的另一边，饼干的英语被称为 “Cracker”，然而较为有趣的是，从美国市场流入中国广东来的 饼干，广东人却 称它为“克力架  ”，有人认为这是广东人为饼干营销而作出的“ 噱头 ”，不以为然，其实他们都错了。因为在美国英语里 ，饼干就叫Cracker，只是广东人按粤语音译为“克力架”。而法语饼干名称“Biscuit”在美国英语中是指“热食的软饼”，即可丽饼、华夫饼等等。\r\n\r\n\r\n时至今日，市面上的饼干产品已是多种多样，但总体而言分为两大类，分别是美国式的“薄而脆”和英国式的“厚而酥”，而近期流行的“披萨饼干”，也是采用西方披萨外形，增加水果元素，给传统饼干带来创新。','8','0',3333,0,'2023-03-17 20:36:14.478236',0,0,1,1,2),(5,'哈哈哈','cover/1679058036014.jpeg','哈哈哥哥','98','0',2,0,'2023-03-17 20:36:38.492528',0,0,2,2,1),(6,'小红色敞篷车','cover/1679229610791.jpeg','这款 Red 小跑车采用复古造型和高品质结构。 耐用的钢体、真正的橡胶轮胎和经典的加工提供了可靠的骑行体验,可持续使用多年。 工作转向帮助孩子在学习如何转向时发展运动技能。 舒适的座椅靠背增加了符合人体工程学的支撑力,橡胶轮胎提供安静、无刮痕的骑行体验。 Honking 喇叭增加了乐趣。最大承重能力为 42 磅。 适合 1-3 岁的儿童。','211','0',1111,0,'2023-03-19 20:40:53.393238',0,0,0,0,4),(7,'Little Tikes','cover/1679229780971.jpeg','Little Tikes 易得分篮球套装专为 18 个月至 5 岁的儿童设计,向孩子们介绍各种能力的篮球比赛和比赛。 高度可在 2.5 至 1.2 米之间进行六种设置,甚至是小的呼啦圈星星。 超大篮筐和儿童篮球确保轻松得分,帮助孩子发展手眼协调能力,同时提供合适的挑战水平。 在玩之前,将沙子添加到底座上以确保稳定性。','211','0',213,0,'2023-03-19 20:43:38.294480',0,0,0,0,4),(8,'恐龙舒适轿车','cover/1679229853940.jpeg','介绍 Little Tikes 舒适情侣恐龙。 几代，孩子们在玩具上 Cozy Coupee 的原始骑行者，一直在道路上冒险和想象力。 现在这款经典的儿童跑车拥有全新的外观 - 穿上我们的 Cozy Coupe Dino 骑行吧！ 有趣的恐龙造型让小孩子想象力奔跑，鼓励各种冒险。','54','0',345,0,'2023-03-19 20:44:33.546024',0,0,0,0,4),(9,'婴儿摇铃玩具','cover/1679229963230.jpeg','2003年，宝贝儿子呱呱坠地，让Ellen和Michael Diamant初尝为人父母的喜悦。像多数新晋爸妈一样，幸福之余面对琳琅满目的婴儿产品，要在很短的时间内选出满意的方案，他们也难免感到不知所措。\r\n为了觅得一款又美观又实用的尿布袋，他们各处寻找却一无所获，由此决定自力更生，踏上设计之途。\r\n将近十年来，Ellen和Michael先后推出数百种产品，始终致力于打造以“一切各得其所”为理念的解决方案，旨在为和自己一样忙碌的父母奉上贴心、实用而美观的产品。\r\n如今，SkipHop已成为婴儿用品行业备受赞誉的全球品牌，以创新、出色的设计和优异的品质赢得有要求的爸妈们的一致肯定。','876','0',479,0,'2023-03-19 20:46:23.734708',0,0,0,0,4),(10,'贝适安busybuddy狗狗漏食玩具','cover/1679230045590.jpeg','总公司创立于1988年，旗下的玩具品牌Busy Buddy，为一系列可塞零食抗***的创意玩具，每个玩具各有其独特的造型，相对的就有其专属的塞零食方式，可当成***赏玩具，也可以陪伴狗狗度过独处的时光，激发狗狗无线创意，同时消耗精力释放压力。天然无毒材质，结构密实。请依照狗狗体型及嗜咬程度选择正确的尺寸，才能让玩具发挥功效，并延长玩具的寿命。Busy Buddy曾因出色的设计和性能在国际宠物界多次***。目前产地是中国，产品主要在北美及欧洲销售。','32','0',65,0,'2023-03-19 20:47:33.732547',0,0,0,0,4),(11,'大型犬拼图玩具','cover/1679230092657.jpeg','大型犬拼图玩具 狗狗*拼图喂食器 用于智商训练和大脑刺激的玩具 用于*分配的狗狗丰富玩具 慢速喂食 心理刺激作为给小狗、中型、大型犬的礼物','321','0',744,0,'2023-03-19 20:48:34.733491',0,0,0,0,4),(12,'侏罗纪世界 HLP16 玩具','cover/1679230147996.jpeg','美国专业的婴幼儿学习用品品牌，旗下产品涉及针对不同年龄段儿童的学习点读机、学习桌、玩具等。 这款 探索工具箱，适用于2-5岁宝宝，学习拆卸和构建，培养宝宝工程师思维。','56','0',432,0,'2023-03-19 20:49:43.137552',0,0,0,0,4),(13,'快乐小鲁班军事系列积木战斗机','cover/1679230364390.jpeg','孩子到了适当的年纪，开始发挥他们无比的好奇心与想象力。这时候妈妈们就应该为孩子挑选一款适合的积木玩具。积木玩具是培养锻炼儿童智力最好的早教玩具。它提供更多的机会去发挥他们的想象力和创造力。孩子们在摆搭之前要想好自己搭些什么，要观察，思考选用什么样的块块才能体现他所构想的形象，因此对儿童的想象力，结构思维，造型能力是很好的锻炼，而且可发展孩子们的空间知觉，创造力，发挥儿童组织力和理解力，增强耐力及对建筑科学的兴趣。\r\n那么孩子玩积木玩具的有什么好处？ \r\n积木玩具可以锻炼宝宝以下能力：\r\n1、通过一些动作，处理视觉输入。良好的手触摸，眼睛协调能力也有利于一般身体协调和平衡。\r\n2、创造力和想象力的发挥能促进孩子们不断尝试一些新的想法，帮助他们逐渐形成一种创新思维和不断寻找解决问题的新方法。\r\n3、有利于发展“空间智慧”。孩子在玩具积木的过程中不停地研究布局、结构，这有利于他们掌握物体形状，辨别空间方位，把握二维和三维空间及其转换。\r\n4、帮助孩子们学会通过推理，来得出结论，包括数学，逻辑推理，科学分析等思维形式。在孩子们成长的过程中需要这种能力进行有效的统计，测量，推理，归纳，分析等。','432','0',321,0,'2023-03-19 20:54:05.429884',0,0,0,0,4),(14,'烧烤和Groove Camper - 玩具套装带','cover/1679230543572.jpeg','孩子到了适当的年纪，开始发挥他们无比的好奇心与想象力。这时候妈妈们就应该为孩子挑选一款适合的积木玩具。积木玩具是培养锻炼儿童智力最好的早教玩具。它提供更多的机会去发挥他们的想象力和创造力。孩子们在摆搭之前要想好自己搭些什么，要观察，思考选用什么样的块块才能体现他所构想的形象，因此对儿童的想象力，结构思维，造型能力是很好的锻炼，而且可发展孩子们的空间知觉，创造力，发挥儿童组织力和理解力，增强耐力及对建筑科学的兴趣。\r\n那么孩子玩积木玩具的有什么好处？