不饱，所以吃多了也不容易察觉。其实，三块巧克力威化饼的热量就已经超过200卡路里了。\r\n\r\n四：夹心饼干\r\n\r\n“心”是添加剂合成，没有水果原料\r\n\r\n夹心饼干是在两块饼干之间添加糖、油脂或果酱为主要原料的各种夹心料的夹心焙烤食品。夹心饼干里的“心”为追求味道和颜色会使用添加剂，一般是 香精和色素，很少真正添加什么水果原料，\r\n\r\n比如橘子味夹心饼干，不是加入橘子，而是添加剂调和成的，虽然添加剂不一定有害，但不会带来营养，可能还不如单纯 的饼干好。因此不管多么美味的饼干都只能小食，而且饼干多半都很干，食用后很容易出现有\"热气\"(上火)针状。因此在平时生活中，对各种夹心饼干也只能点到为止。\r\n\r\n五：全麦饼干\r\n\r\n提高了营养同时也提高了油脂量\r\n\r\n纤维素含量较高的全麦饼干，因为纤维素口感较差，为弥补口感，生产商往往会在饼干里加入很多油，导致油脂含量较高。但如果包装上标榜的所谓全麦、燕麦、黑麦、五谷饼干等原料，在配料表里排名倒数几位，那可能不是真正的谷物饼干。','901','0',321,0,'2023-03-19 21:11:17.327821',0,0,0,0,2),(28,'SKATER 斯凯达 便当盒 储存容','cover/1679232418133.jpeg','饼干的诞生，背后的故事也同样充满着意外性，在 十九世纪五十年代的某一天，天空乌云密布，忽起狂风，使一艘出海勘察英国帆船触礁，被迫在法国比斯湾附近的一个荒岛上停泊，船员们虽死里逃生，但岛上没有任何食物亦是船员们重生后的又一个难题。百般无奈的他们只好等风停后再次登上那艘已经破烂不堪的船上搜刮粮食，但遗憾的是，船上储备的面粉、奶油、砂糖等等都已经泡在水里了，船员们毫无办法，只好将这一切几乎已经泡烂的东西带到岛上，待面团稍微烘干一点后，将它一点一点地撕下，捏成一个个小团，然后烤熟后分给大家吃。但让人感到意外的是，用此方法烤出来的东西竟是如此美味，酥松香脆，且饱腹感强，船员们因此也有了生存下去的希望。一段时间过后，船员们回到了英国，为了纪念此次脱险，他们再一次用这个方法做出来了同样的美味，并以海湾的名字命名这一份美味为 “比斯湾”，这就是饼干的英文名“ biscuit”的由来。\r\n\r\n然而在世界的另一边，饼干的英语被称为 “Cracker”，然而较为有趣的是，从美国市场流入中国广东来的 饼干，广东人却 称它为“克力架  ”，有人认为这是广东人为饼干营销而作出的“ 噱头 ”，不以为然，其实他们都错了。因为在美国英语里 ，饼干就叫Cracker，只是广东人按粤语音译为“克力架”。而法语饼干名称“Biscuit”在美国英语中是指“热食的软饼”，即可丽饼、华夫饼等等。\r\n\r\n\r\n时至今日，市面上的饼干产品已是多种多样，但总体而言分为两大类，分别是美国式的“薄而脆”和英国式的“厚而酥”，而近期流行的“披萨饼干”，也是采用西方披萨外形，增加水果元素，给传统饼干带来创新。','531','0',222,0,'2023-03-19 21:27:07.696079',0,0,0,0,2),(29,'米饭，我是汉堡！','cover/1679232448857.jpeg','饼干的诞生，背后的故事也同样充满着意外性，在 十九世纪五十年代的某一天，天空乌云密布，忽起狂风，使一艘出海勘察英国帆船触礁，被迫在法国比斯湾附近的一个荒岛上停泊，船员们虽死里逃生，但岛上没有任何食物亦是船员们重生后的又一个难题。百般无奈的他们只好等风停后再次登上那艘已经破烂不堪的船上搜刮粮食，但遗憾的是，船上储备的面粉、奶油、砂糖等等都已经泡在水里了，船员们毫无办法，只好将这一切几乎已经泡烂的东西带到岛上，待面团稍微烘干一点后，将它一点一点地撕下，捏成一个个小团，然后烤熟后分给大家吃。但让人感到意外的是，用此方法烤出来的东西竟是如此美味，酥松香脆，且饱腹感强，船员们因此也有了生存下去的希望。一段时间过后，船员们回到了英国，为了纪念此次脱险，他们再一次用这个方法做出来了同样的美味，并以海湾的名字命名这一份美味为 “比斯湾”，这就是饼干的英文名“ biscuit”的由来。\r\n\r\n然而在世界的另一边，饼干的英语被称为 “Cracker”，然而较为有趣的是，从美国市场流入中国广东来的 饼干，广东人却 称它为“克力架  ”，有人认为这是广东人为饼干营销而作出的“ 噱头 ”，不以为然，其实他们都错了。因为在美国英语里 ，饼干就叫Cracker，只是广东人按粤语音译为“克力架”。而法语饼干名称“Biscuit”在美国英语中是指“热食的软饼”，即可丽饼、华夫饼等等。\r\n\r\n\r\n时至今日，市面上的饼干产品已是多种多样，但总体而言分为两大类，分别是美国式的“薄而脆”和英国式的“厚而酥”，而近期流行的“披萨饼干”，也是采用西方披萨外形，增加水果元素，给传统饼干带来创新。','152','0',315,0,'2023-03-19 21:27:44.825427',0,0,0,0,2),(30,'SKATER 斯凯达 收纳盒 折叠收纳','cover/1679232480948.jpeg','饼干的诞生，背后的故事也同样充满着意外性，在 十九世纪五十年代的某一天，天空乌云密布，忽起狂风，使一艘出海勘察英国帆船触礁，被迫在法国比斯湾附近的一个荒岛上停泊，船员们虽死里逃生，但岛上没有任何食物亦是船员们重生后的又一个难题。百般无奈的他们只好等风停后再次登上那艘已经破烂不堪的船上搜刮粮食，但遗憾的是，船上储备的面粉、奶油、砂糖等等都已经泡在水里了，船员们毫无办法，只好将这一切几乎已经泡烂的东西带到岛上，待面团稍微烘干一点后，将它一点一点地撕下，捏成一个个小团，然后烤熟后分给大家吃。但让人感到意外的是，用此方法烤出来的东西竟是如此美味，酥松香脆，且饱腹感强，船员们因此也有了生存下去的希望。一段时间过后，船员们回到了英国，为了纪念此次脱险，他们再一次用这个方法做出来了同样的美味，并以海湾的名字命名这一份美味为 “比斯湾”，这就是饼干的英文名“ biscuit”的由来。\r\n\r\n然而在世界的另一边，饼干的英语被称为 “Cracker”，然而较为有趣的是，从美国市场流入中国广东来的 饼干，广东人却 称它为“克力架  ”，有人认为这是广东人为饼干营销而作出的“ 噱头 ”，不以为然，其实他们都错了。因为在美国英语里 ，饼干就叫Cracker，只是广东人按粤语音译为“克力架”。而法语饼干名称“Biscuit”在美国英语中是指“热食的软饼”，即可丽饼、华夫饼等等。\r\n\r\n\r\n时至今日，市面上的饼干产品已是多种多样，但总体而言分为两大类，分别是美国式的“薄而脆”和英国式的“厚而酥”，而近期流行的“披萨饼干”，也是采用西方披萨外形，增加水果元素，给传统饼干带来创新。','315','0',415,0,'2023-03-19 21:28:13.898216',0,0,0,0,2),(31,'套烧烤汉堡套装，高品质汉堡套装，配有 Pro 汉堡压榨','cover/1679232514230.jpeg','饼干的诞生，背后的故事也同样充满着意外性，在 十九世纪五十年代的某一天，天空乌云密布，忽起狂风，使一艘出海勘察英国帆船触礁，被迫在法国比斯湾附近的一个荒岛上停泊，船员们虽死里逃生，但岛上没有任何食物亦是船员们重生后的又一个难题。百般无奈的他们只好等风停后再次登上那艘已经破烂不堪的船上搜刮粮食，但遗憾的是，船上储备的面粉、奶油、砂糖等等都已经泡在水里了，船员们毫无办法，只好将这一切几乎已经泡烂的东西带到岛上，待面团稍微烘干一点后，将它一点一点地撕下，捏成一个个小团，然后烤熟后分给大家吃。但让人感到意外的是，用此方法烤出来的东西竟是如此美味，酥松香脆，且饱腹感强，船员们因此也有了生存下去的希望。一段时间过后，船员们回到了英国，为了纪念此次脱险，他们再一次用这个方法做出来了同样的美味，并以海湾的名字命名这一份美味为 “比斯湾”，这就是饼干的英文名“ biscuit”的由来。\r\n\r\n然而在世界的另一边，饼干的英语被称为 “Cracker”，然而较为有趣的是，从美国市场流入中国广东来的 饼干，广东人却 称它为“克力架  ”，有人认为这是广东人为饼干营销而作出的“ 噱头 ”，不以为然，其实他们都错了。因为在美国英语里 ，饼干就叫Cracker，只是广东人按粤语音译为“克力架”。而法语饼干名称“Biscuit”在美国英语中是指“热食的软饼”，即可丽饼、华夫饼等等。\r\n\r\n\r\n时至今日，市面上的饼干产品已是多种多样，但总体而言分为两大类，分别是美国式的“薄而脆”和英国式的“厚而酥”，而近期流行的“披萨饼干”，也是采用西方披萨外形，增加水果元素，给传统饼干带来创新。','365','0',432,0,'2023-03-19 21:28:47.277461',0,0,0,0,2),(32,'疯狂汉堡游戏 快速建立','cover/1679232543082.jpeg','饼干的诞生，背后的故事也同样充满着意外性，在 十九世纪五十年代的某一天，天空乌云密布，忽起狂风，使一艘出海勘察英国帆船触礁，被迫在法国比斯湾附近的一个荒岛上停泊，船员们虽死里逃生，但岛上没有任何食物亦是船员们重生后的又一个难题。百般无奈的他们只好等风停后再次登上那艘已经破烂不堪的船上搜刮粮食，但遗憾的是，船上储备的面粉、奶油、砂糖等等都已经泡在水里了，船员们毫无办法，只好将这一切几乎已经泡烂的东西带到岛上，待